pragma experimental ABIEncoderV2;
pragma solidity >=0.5.5 <0.6.0;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract HashTimeLock {
  using SafeERC20 for IERC20;

  mapping(bytes32 => LockContract) public contracts;

  enum SwapStatus { INVALID, ACTIVE, REFUNDED, WITHDRAWN, EXPIRED }

  struct LockContract {
    uint256 inputAmount;
    uint256 outputAmount;
    uint256 expiration;
    bytes32 hashLock;
    SwapStatus status;
    address tokenAddress;
    address sender;
    address receiver;
    string outputNetwork;
    string outputAddress;
  }

  event Withdraw(
    bytes32 id,
    bytes32 secret,
    bytes32 hashLock,
    address indexed tokenAddress,
    address indexed sender,
    address indexed receiver
  );

  event Refund(
    bytes32 id,
    bytes32 hashLock,
    address indexed tokenAddress,
    address indexed sender,
    address indexed receiver
  );

  event NewContract(
    uint256 inputAmount,
    uint256 outputAmount,
    uint256 expiration,
    bytes32 id,
    bytes32 hashLock,
    address indexed tokenAddress,
    address indexed sender,
    address indexed receiver,
    string outputNetwork,
    string outputAddress
  );

  modifier withdrawable(bytes32 id, bytes32 secret, address tokenAddress) {
    LockContract memory tempContract = contracts[id];
    require(tempContract.tokenAddress == tokenAddress, 'INVALID_TOKEN');
    require(tempContract.status == SwapStatus.ACTIVE, 'SWAP_NOT_ACTIVE');
    require(tempContract.expiration > block.timestamp, 'INVALID_TIME');
    require(
      tempContract.hashLock == sha256(abi.encodePacked(secret)),
      'INVALID_SECRET'
    );
    _;
  }

  modifier refundable(bytes32 id, address tokenAddress) {
    LockContract memory tempContract = contracts[id];
    require(tempContract.tokenAddress == tokenAddress, 'INVALID_TOKEN');
    require(tempContract.status == SwapStatus.ACTIVE, 'SWAP_NOT_ACTIVE');
    require(tempContract.expiration <= block.timestamp, 'INVALID_TIME');
    require(tempContract.sender == msg.sender, 'INVALID_SENDER');
    _;
  }

  function newContract(
    uint256 inputAmount,
    uint256 outputAmount,
    uint256 expiration,
    bytes32 hashLock,
    address tokenAddress,
    address receiver,
    string memory outputNetwork,
    string memory outputAddress
  ) public {
    address sender = msg.sender;

    require(expiration > block.timestamp, 'INVALID_TIME');

    require(inputAmount > 0, 'INVALID_AMOUNT');

    IERC20(tokenAddress).safeTransferFrom(sender, address(this), inputAmount);

    bytes32 id = sha256(
      abi.encodePacked(sender, receiver, inputAmount, hashLock, expiration)
    );

    contracts[id] = LockContract(
      inputAmount,
      outputAmount,
      expiration,
      hashLock,
      SwapStatus.ACTIVE,
      tokenAddress,
      sender,
      receiver,
      outputNetwork,
      outputAddress
    );

    emit NewContract(
      inputAmount,
      outputAmount,
      expiration,
      id,
      hashLock,
      tokenAddress,
      sender,
      receiver,
      outputNetwork,
      outputAddress
    );
  }

  function withdraw(bytes32 id, bytes32 secret, address tokenAddress)
    public
    withdrawable(id, secret, tokenAddress)
    returns (bool)
  {
    LockContract storage c = contracts[id];
    c.status = SwapStatus.WITHDRAWN;
    IERC20(tokenAddress).safeTransfer(c.receiver, c.inputAmount);
    emit Withdraw(id, secret, c.hashLock, tokenAddress, c.sender, c.receiver);
    return true;
  }

  function refund(bytes32 id, address tokenAddress) external refundable(id, tokenAddress) returns (bool) {
    LockContract storage c = contracts[id];
    c.status = SwapStatus.REFUNDED;
    IERC20(tokenAddress).safeTransfer(c.sender, c.inputAmount);
    emit Refund(id, c.hashLock, tokenAddress, c.sender, c.receiver);
    return true;
  }

  function getStatus(bytes32[] memory ids)
    public
    view
    returns (uint8[] memory)
  {
    uint8[] memory result = new uint8[](ids.length);

    for (uint256 index = 0; index < ids.length; index++) {
      result[index] = getStatus(ids[index]);
    }

    return result;
  }

  function getStatus(bytes32 id) public view returns (uint8 result) {
    LockContract memory tempContract = contracts[id];

    if (
      tempContract.status == SwapStatus.ACTIVE &&
      tempContract.expiration < block.timestamp
    ) {
      result = uint8(SwapStatus.EXPIRED);
    } else {
      result = uint8(tempContract.status);
    }
  }
}
